## This is a basic workflow to help you get started with Actions

name: CI

# Controls when the workflow will run
on:
  # Triggers the workflow on push or pull request events but only for the "main" branch
  push:
    branches: [ "main" ]
  pull_request:
    branches: [ "main" ]

  # Allows you to run this workflow manually from the Actions tab
  workflow_dispatch:

# A workflow run is made up of one or more jobs that can run sequentially or in parallel
jobs:
  # This workflow contains a single job called "build"
  build:
    # The type of runner that the job will run on
    runs-on: ubuntu-latest

    # Steps represent a sequence of tasks that will be executed as part of the job
    steps:
      # Checks-out your repository under $GITHUB_WORKSPACE, so your job can access it
      - uses: actions/checkout@v3

      # populate result value
      - name: populate result value
        id: populate-result-value
        run: |
          resultValue=""
          # for i in {1..12}
          # do
          #   resultValue="$resultValue$resultValue"
          # done
          # echo "$resultValue"
          echo "resultValue=$resultValue" >> $GITHUB_OUTPUT

    # populate result
      - name: Run a one-line script
        id: populate-result
        run: |
          echo "result=hello" >> $GITHUB_OUTPUT
          
    # Populate error
      - name: populate error
        id: populate-error
        run: |
          echo "error_code=EOO1" >> $GITHUB_OUTPUT
          echo "error_msg=Internal Error." >> $GITHUB_OUTPUT

      # Runs a set of commands using the runners shell
      - name: Run a multi-line script
        run: |
          echo '${{ toJSON(steps) }}' | jq 'to_entries | map({key: .key, value: {outputs:{result:.value.outputs.result,error_code:.value.outputs.error_code,error_msg:.value.outputs.error_msg},conclusion:.value.conclusion}})|from_entries'

      - name: print step context
        id: print-step-context
        uses: shyjuabhilash/test-arguments-action@main
        with:
          stepsContext: ${{toJSON(steps)}}
